package com.graph;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.Collection;
import java.util.HashMap;
import java.util.HashSet;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Queue;
import java.util.Set;

public class StringTransformation {

  public static void main(String[] args) {

    String[] words = {"" };
    String start = "cccc";
    String stop = "cccc";
    Set<String> input = new HashSet<String>(Arrays.asList(words));
    input.add(start);
    input.add(stop);
    for (String s : words)
      System.out.print(s + ", ");
    System.out.println();
    String[] res = string_transformation(input, start, stop);

    for (String s : res)
      System.out.print(s + ", ");


  }

  private static String[] string_transformation(Set<String> words, String start, String stop) {
    
    List<String> res = new ArrayList<String>();
    Graph g = new Graph();
    Map<String, List<String>> ref = new HashMap<String, List<String>>();
    for (String s : words) {
      char[] sArr = s.toCharArray();

      for (int i = 0; i < sArr.length; i++) {
        char temp = sArr[i];
        sArr[i] = '*';
        String oneEdit = String.valueOf(sArr);
        if (ref.containsKey(oneEdit)) {
          ref.get(oneEdit).add(s);
        } else {
          List<String> relatedWords = new ArrayList<String>();
          relatedWords.add(s);
          ref.put(oneEdit, relatedWords);
        }
        sArr[i] = temp;
      }


    }


    for (String s : ref.keySet()) {
      for (int i = 0; i < ref.get(s).size(); i++) {
        String currString = ref.get(s).get(i);
        for (int j = i + 1; j < ref.get(s).size(); j++) {
          String neighborString = ref.get(s).get(j);
          g.addEdge(currString, neighborString);
          g.addEdge(neighborString, currString);
        }
      }
    }

    if(!g.getSrc().containsKey(start)) {
      res.add("-1");
      return res.toArray(new String[0]);
  }
    Queue<String> q = new LinkedList<String>();
    Map<String, String> backTrack = new HashMap<String, String>();
    Set<String> visited = new HashSet<String>();
    visited.add(start);
    for (String s : g.getSrc().get(start)) {
      if(!visited.contains(s)) {
        q.add(s);
        visited.add(s);
        
        backTrack.put(s, start);
      }
      
    }
    boolean isFound = false;
    
    visited.add(start);
    backTrack.put(start, null);
    while (!q.isEmpty() && !isFound) {
      String curStr = q.poll();

      if (curStr.equalsIgnoreCase(stop)) {
        isFound = true;
        break;
      }

      for (String s : g.getSrc().get(curStr)) {
        if(!visited.contains(s)) {
          q.add(s);
          visited.add(s);
          
          backTrack.put(s, curStr);
        }
        
      }
    }
    if (isFound) {
      String chain = stop;
      while (chain != null) {
        res.add(chain);
        chain = backTrack.getOrDefault(chain, null);
      }
    } else {
      res.add("-1");
    }
   String[] resArr = new String[res.size()];
    int index=0;
    for(int i=res.size()-1; i>=0 ; i--) {
      resArr[index++]= res.get(i);
    }
    return  resArr;
    
  }

  static class Graph {
    Map<String, List<String>> src;

    Graph() {

      this.src = new HashMap<String, List<String>>();
    }

    public void addEdge(String src, String neighbor) {
      if (this.src.containsKey(src)) {
        this.src.get(src).add(neighbor);
      } else {
        List<String> neighbors = new ArrayList<String>();
        neighbors.add(neighbor);
        this.src.put(src, neighbors);
      }
    }

    public Map<String, List<String>> getSrc() {
      return src;
    }

    public void setSrc(Map<String, List<String>> src) {
      this.src = src;
    }

    @Override
    public String toString() {
      return src.toString();
    }

  }

  static class Node {
    String str;
    List<String> neighbors;

    Node() {
      this.neighbors = new ArrayList<String>();
    }
  }

}
